    constructor(props) {
        super(props);
        this.state = { 
            tradecollateral: null,
            accountballance: null,
            faktor: null,
            einstiegspreis: null
         }
    }
    render() { 
        return (  
            <div>
                <h1>Margin Level Calculator</h1>
                <input type="number" id="1" name="tradecollateral" placeholder="Trade Collateral" />
                <br></br>
                <input type="number" id="2" name="accountballance" value="" placeholder="Account Ballance" />
                <br></br>
                <input type="number" id="3" name="faktor" value="" placeholder="Faktor/Hebel"/>
                <br></br>
                <input type="number" id="4" name="einstiegspreis" value="" placeholder="Einstiegspreis: "/>
                <br></br>
                <button id="5">Create Position</button>
                <p>Aktueller Preis:</p> <p 
                id="ladn">loading...</p>
                <p>Kursverlauf:</p>
                <p>Trade Collateral: </p> 
                <p>Account Ballance:</p>
                <p>Eingesetzter Faktor/Hebel:</p>
                <p>Einstiegspreis:</p> 
                <p>Profit/Loss:</p>  
                <p>Leverage (Gehebelter Betrag):</p> 
                <p>Equity:</p>  
                <p>Marginlevel:</p>            
            </div>
        );
    }
}

export default NewPosition;
